  };
  console.log(data.bbox[0])

  return (
      <MapContainer
        center={[ 13.21,76.15]}
        zoom={7}
        className="map-container"
        
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        />
        <GeoJSON data={data} style={setColor}/>
      </MapContainer>
  );
}

export default Map;
